<div class="entities" style="line-height: 2.5; direction: ltr">DB00125 metabolic enzymes , nitric oxide and infection . DB00435 ( NO ) is synthesized from arginine by NO synthase ( NOS ) , and the availability of arginine is one of the rate-limiting factors in cellular NO production .

<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

<h2 style="margin: 0">10</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Novel and emerging drugs for acute myeloid leukemia : pharmacology and therapeutic activity . For the last twenty years , significant progress in Molecular and Cellular Biology has resulted in a better characterization and understanding of the biology and prognosis of acute myeloid leukemia ( AML ) . These achievements have provided new opportunities for the development of innovative , more effective therapies . Novel agents potentially useful in the treatment of patients with AML include new formulations of established drugs , newer nucleoside analogs , molecular target drugs , monoclonal antibodies and other agents . Three newer nucleoside analogs , clofarabine , troxacitabine and sapacitabine have been recently investigated in patients with AML . Two methylation inhibitors , 5 - azacyticline and decitabine are pyrimidine nucleoside analogs of cytidine which can be incorporated into RNA and / or DNA . Lower doses of these agents are active in AML and have been extensively investigated , especially in secondary AML and AML in elderly patients . DB04960 and lonafarnib are orally available farnesyltransferase inhibitors with in vitro and in vivo activity against AML . In recent years ,

</mark>
 inhibitors , lestaurinib , 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 and PKC 412 have been developed and tested in AML . The preclinical observations and clinical studies indicate that 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 inhibitors are promising agents in the treatment of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 , is an experimental anticancer drug that recently entered human clinical trials . It is a member of a novel class of antiproliferative agents known as G-rich oligonucleotides (

 in response to tumor necrosis factor-alpha stimulation . Using a reporter gene assay , we showed that

 blocks both tumor necrosis factor-alpha-induced and constitutive NF-kappaB activity in human cancer cell lines derived from cervical , prostate , breast , and lung carcinomas . In addition , we showed that , in

 - treated cancer cells ,

 is coprecipitated by nucleolin , indicating that both proteins are present in the same complex . Our studies suggest that abrogation of NF-kappaB activity may contribute to the anticancer effects of

 beta-mediated phosphorylation of
